import React from 'react';
import classes from './TodoItem.module.css';
import Todo from '../models/todo';

const TodoItem: React.FC<{ item: Todo; deleteItem: (id: string) => void }> = (props) => {
    const onClickDeleteBtn = (id: string) => {
        props.deleteItem(id);
    };

    return (
        <>
            <li className={classes.item}>{props.item.text}</li>
            <button onClick={() => onClickDeleteBtn(props.item.id)}>delete</button>
        </>
    );
};

export default TodoItem;
